@dominocollege @AAPLTree For two reasons : from the door of the store these commodities lose so much value.

And their happiness fonction with the product is tolerating a far shittier experience than we (you and I) would accept.

It might all be dead weight in their minds. 2/2

@dominocollege @AAPLTree (I’ll get burned for what I say here)

« Regular people » think in pretty weird terms about their electronics. 

They’re too used to commodities that they hold onto till they break down. 1/2
